import React from "react";

const MoodList = ({ moods, onDeleteMood }) => {
  return (
    <div>
      <h2>Mood List</h2>
      {moods.length === 0 ? (
        <p>No moods to display</p>
      ) : (
        <ul>
          {moods.map((mood) => (
            <li key={mood._id}>
              <p><strong>Message:</strong> {mood.message}</p>
              <p><strong>Date:</strong> {new Date(mood.date).toLocaleDateString()}</p>
              <p><strong>Suggestions:</strong> {mood.suggestions?.join(", ")}</p>
              <button onClick={() => onDeleteMood(mood._id)}>Delete</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default MoodList;
